  CONSTRAINT `FKk6dud708wr06b006j541fv4bs` FOREIGN KEY (`shop_id`) REFERENCES `t_shop` (`id`),
  CONSTRAINT `FKmhbfdvb0iopy7knaioya9uch4` FOREIGN KEY (`vip_card_id`) REFERENCES `t_vipcard` (`id`)
