-- ----------------------------
-- Table structure for `t_order_info`
-- ----------------------------
DROP TABLE IF EXISTS `t_order_info`;
CREATE TABLE `t_order_info` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` varchar(255) COLLATE utf8_bin NOT NULL,
  `menber_id` bigint(11) DEFAULT NULL,
  `menber_name` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `menber_phone` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `menber_discount` double DEFAULT '1' COMMENT '会员折扣',
  `goods_total_cost` double NOT NULL DEFAULT '0' COMMENT '订单商品总成本',
  `goods_total_price` double NOT NULL COMMENT '订单商品总价格',
  `order_discount` double NOT NULL COMMENT '订单折扣',
  `order_amount` double NOT NULL COMMENT '订单终价',
  `order_time` datetime NOT NULL,
  `pay_time` datetime NOT NULL,
  `salesman_id` bigint(20) DEFAULT NULL,
  `shop_id` bigint(20) DEFAULT NULL,
  `type` int(11) DEFAULT NULL,
